import React,{useContext} from 'react'
import {AuthContext} from "../context/AuthContext";
import { useHistory } from  'react-router-dom'
import {NavLink} from "react-router"



export const Navbar = () =>{
    const auth = useContext(AuthContext)
    const history =useHistory()

    const logoutHandler = event =>{
        event.preventDefault()
        auth.logout()
        history.push('/')
    }

    return (
        <nav>
            <div className="nav-wrapper blue-grey-1 " style={{padding: '0 2rem'}}>
                <span className="brand-logo"> sokrash4eniya ssulok </span>
                <ul id="nav-mobile" className="right hide-on-med-and-down">
                    <li><NavLink to ="/create"> sozdat</NavLink></li>
                    <li><NavLink to= " /links"> Sozdat</NavLink></li>
                    <li> <a href="/" onClick={logoutHandler}>  </a>vuytu</li>
                </ul>
            </div>
        </nav>


    )

}
